text:
• Sinh viên được miễn 04 học phần Anh văn nếu đã đạt chuẩn ngoại ngữ đầu ra.

• Để được đăng ký và học các học phần chuyên ngành, sinh viên phải thỏa mãn một trong ba điều kiện sau đây:

  o Đã đạt chuẩn ngoại ngữ đầu ra;

  o Đã hoàn tất 04 học phần Anh văn;

  o Đạt được từ 5,0 điểm trở lên trong kỳ thi đánh giá trình độ tiếng Anh nội bộ do trường tổ chức.
